import React, { Component } from 'react';
import { Tabs, Tab, Grid, Cell, Card, CardActions, CardTitle, CardMenu, Button, IconButton, CardText, Icon } from 'react-mdl';
class Projects extends Component {

    constructor(props) {
        super(props);
        this.state = { activeTab: 0 };

    }

    toggleCategories() {
        if(this.state.activeTab === 0){
            return (
                <div className="projects-grid">
                    <Card shadow={5} style={{minWidth: '450', margin: 'auto'}}>
                        <CardTitle style={{color: '#fff', height: '176px', background: 'url(https://cdn.worldvectorlogo.com/logos/react-1.svg) center / cover'}}> Python Project #1</CardTitle>
                        <CardText>
                            Python Project 1
                        </CardText>
                        <CardActions border>
                            <Button colored>Github</Button>
                        </CardActions>
                        <CardMenu style={{color: '#fff'}}>
                            <IconButton name="share" />
                        </CardMenu>
                    </Card>
                    <Card shadow={5} style={{minWidth: '450', margin: 'auto'}}>
                        <CardTitle style={{color: '#fff', height: '176px', background: 'url(https://cdn.worldvectorlogo.com/logos/react-1.svg) center / cover'}}> Python Project #2</CardTitle>
                        <CardText>
                            Python Project 1
                        </CardText>
                        <CardActions border>
                            <Button colored>Github</Button>
                        </CardActions>
                        <CardMenu style={{color: '#fff'}}>
                            <IconButton name="share" />
                        </CardMenu>
                    </Card>
                    <Card shadow={5} style={{minWidth: '450', margin: 'auto'}}>
                        <CardTitle style={{color: '#fff', height: '176px', background: 'url(https://cdn.worldvectorlogo.com/logos/react-1.svg) center / cover'}}> Python Project #3</CardTitle>
                        <CardText>
                            Python Project 1
                        </CardText>
                        <CardActions border>
                            <Button colored>Github</Button>
                        </CardActions>
                        <CardMenu style={{color: '#fff'}}>
                            <IconButton name="share" />
                        </CardMenu>
                    </Card>
                </div>
            )
        } else if(this.state.activeTab === 1){
            return (
                <div><h1>This is React-Native</h1></div>
            )
        } else if(this.state.activeTab === 2){
            return (
                <div><h1>This is Angular</h1></div>
            )
        }
    }


    render() {
        return(
            <div class="category-tabs">

                <Tabs activeTab={this.state.activeTab} onChange={ (tabId) => this.setState({ activeTab: tabId}) } ripple>
                    <Tab>Python</Tab>
                    <Tab>React-Native</Tab>
                    <Tab>Angular</Tab>
                </Tabs>

                <Grid>
                    <Cell col={12}>
                        <div className="content">{this.toggleCategories()}</div>
                    </Cell>
                </Grid>


            </div>
        );
    };
};

export default Projects;
